import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AdminPanel = () => {
  const [bookings, setBookings] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchBookings() {
      try {
        const res = await axios.get('/api/bookings', { params: { role: 'admin' } });
        if (res.data.success) {
          const bookingsWithFormattedDate = res.data.bookings.map(b => ({
            ...b,
            booking_date: b.booking_date ? new Date(b.booking_date).toLocaleDateString('en-GB') : ''
          }));
          setBookings(bookingsWithFormattedDate);
        }
      } catch (error) {
        console.error('Error fetching bookings:', error);
      }
    }
    fetchBookings();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('userId');
    localStorage.removeItem('username');
    navigate('/');
  };

  return (
    <div style={styles.pageContainer}>
      <div style={styles.panelContainer}>
        <button onClick={handleLogout} style={styles.logoutButton}>
          Logout
        </button>
        <h2 style={styles.heading}>Admin Panel - All Bookings</h2>
        <div style={{ overflowX: 'auto' }}>
          <table style={styles.table}>
            <thead>
              <tr>
                <th style={styles.th}>Booking ID</th>
                <th style={styles.th}>Username</th>
                <th style={styles.th}>Seat Name</th>
                <th style={styles.th}>Train Name</th>
                <th style={styles.th}>Time Slot</th>
                <th style={styles.th}>Booking Date</th>
                <th style={styles.th}>Source City</th>
                <th style={styles.th}>Destination City</th>
              </tr>
            </thead>
            <tbody>
              {bookings.map(booking => (
                <tr
                  key={booking.id}
                  style={{ cursor: 'pointer' }}
                  onMouseEnter={e => (e.currentTarget.style.backgroundColor = '#f1f1f1')}
                  onMouseLeave={e => (e.currentTarget.style.backgroundColor = '')}
                >
                  <td style={styles.td}>{booking.id}</td>
                  <td style={styles.td}>{booking.username}</td>
                  <td style={styles.td}>{booking.seat_name}</td>
                  <td style={styles.td}>{booking.train_name}</td>
                  <td style={styles.td}>{booking.time_slot}</td>
                  <td style={styles.td}>{booking.booking_date}</td>
                  <td style={styles.td}>{booking.source_city_name}</td>
                  <td style={styles.td}>{booking.destination_city_name}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

const styles = {
  pageContainer: {
    minHeight: '100vh',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    background: 'linear-gradient(to right, #83a4d4, #b6fbff)', // Soft professional gradient
    padding: '20px',
  },
  panelContainer: {
    backgroundColor: '#fff',
    padding: '40px',
    borderRadius: '12px', // Soft corners for the panel
    boxShadow: '0 10px 25px rgba(0, 0, 0, 0.1)', // Refined box shadow for depth
    width: '100%',
    maxWidth: '1000px',
  },
  heading: {
    fontFamily: 'Roboto, sans-serif',
    fontWeight: 'bold',
    fontSize: '26px',
    textAlign: 'center',
    marginBottom: '25px',
    color: '#333',
  },
  logoutButton: {
    position: 'absolute',
    top: '20px',
    right: '20px',
    padding: '12px 18px',
    backgroundColor: '#e74c3c',
    color: 'white',
    border: 'none',
    borderRadius: '8px', // Rounded logout button
    cursor: 'pointer',
    fontSize: '14px',
    transition: 'background-color 0.3s ease',
  },
  logoutButtonHover: {
    backgroundColor: '#c0392b',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginTop: '20px',
    backgroundColor: '#fff',
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)', // Softer shadow for the table
    borderRadius: '8px',
    overflow: 'hidden',
  },
  th: {
    backgroundColor: '#3498db', // Updated table header color
    color: 'white',
    textAlign: 'left',
    padding: '12px 15px',
    fontSize: '16px',
  },
  td: {
    padding: '12px 15px',
    borderBottom: '1px solid #ddd',
    fontSize: '15px',
    color: '#555',
  },
};

export default AdminPanel;
